import logo from './logo.svg';
import './App.css';
import Footer from './Templates/Footer';
import Header from './Templates/Header';
import Navigation from './Routers';

function App() {
  return (
    <div className="mkdf-wrapper">
      <div className="mkdf-wrapper-inner">
        <Header />
        <Navigation />
        <Footer />
      </div>
    </div>
  );
}

export default App;
